create table ALUNO
(
  MAT  VARCHAR(12) PRIMARY KEY,
  NOME VARCHAR(60),
  CPF  VARCHAR(11)
)
;


create table CURSO
(
  COD_CUR  NUMERIC(3) PRIMARY KEY,
  SIGLA    CHAR(3),
  NOME_CUR VARCHAR(30)
)
;



create table DISCIPLINA
(
  COD_DISC      VARCHAR(7) PRIMARY KEY,
  NOME_DISC     VARCHAR(30),
  CARGA_HORARIA NUMERIC(3),
  COD_CURSO     NUMERIC(3) REFERENCES CURSO (COD_CUR)
)
;


create table CURSOU
(
  COD_DISC  VARCHAR(7) REFERENCES DISCIPLINA (COD_DISC) ,
  MAT_ALUNO VARCHAR(12) REFERENCES ALUNO (MAT) ,
  MEDIA     NUMERIC(3,1),
  STATUS    VARCHAR(20)
)
;


